package Dennis.Sungtaek;

public class main {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		for(int i=1;i<10;i++,System.out.println()) {
			for(int j=1;j<10;j++,System.out.print("\t")) {
				System.out.print(i + "*" + j + "=" + i*j);
			}
		}
	}

}
